import React from 'react';
import DeleteIcon from '@material-ui/icons/Delete';

const Lists = (props) => {
    return (
    <div className="todo_style">
    <span><DeleteIcon className="Delete" /></span>
        <li>{props.text}</li>
    </div>
    )
}


export default Lists;
